const require_utils = require('../../../common/utils.cjs');

//#region src/namespaces/admin/generate/utils.ts
const generateFeed = (feed) => {
	if (!require_utils.isObject(feed)) return;
	return require_utils.trimObject({
		"admin:errorReportsTo": require_utils.generateRdfResource(feed.errorReportsTo, require_utils.generatePlainString),
		"admin:generatorAgent": require_utils.generateRdfResource(feed.generatorAgent, require_utils.generatePlainString)
	});
};

//#endregion
exports.generateFeed = generateFeed;